import ProjectsRequestAction from './projectsRequestAction';
import ProjectsSaveDataAction from './projectSaveDataAction';

const projectsActions = {
    projectsRequest: ProjectsRequestAction,
    projectsSaveData: ProjectsSaveDataAction
};

export default {projectsActions};
